package java_programs_te;

public class TypeCast5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
         int a=5;
         float b=a;//implicit
         System.out.println(b);
         double c=10.8;
         int  d=(int)c;
         System.out.println(d);
         int e=77;
         String s=Integer.toString(e);
         System.out.println(s);
         
	}

}
